function Displaycard(props){

    return(
            <div class="card">
                <div class="container">
                <h2 style={{display:"inline"}} ><b>{props.name}</b></h2>
                <p style={{display:"inline"}} >{props.address}</p>
            </div>
            </div>

    );
}

export default Displaycard;
